values:
*Go to your calendar and find your very first entry.&nbsp;&nbsp;
*Pick three lines from it, and type them here, along with the date when they were posted.&nbsp;
*Go to your latest entry, pick two lines and type them also.
*Now list five ways in which you have changed/grown/etc. over that time period.&nbsp;

First entry (Sept. 12, 2004):&nbsp; "The college is awesome, except for the fact that there is a 5:1 ratio of girls vs. guys, with the girls being 5. That happens to be a small set back. Because, if we are being honest, sometimes ya just want someone to cuddle with!&nbsp;&nbsp;

Most recent entry: "Sometimes we have to change our attitude in order to see the beauty in the things that used to fill our thoughts and actions. We have to experience sad, hopeless, less meaningful things before we can truly love and believe in&nbsp;what we have had all along.&nbsp; Just remember that sometimes you really DO have to set people free in order to know if they are your destiny."&nbsp;

5 Ways&nbsp;i Have Changed:&nbsp;
*&nbsp;I have a stronger testimony of the gospel.&nbsp;&nbsp;
* I&nbsp;have more confidence.&nbsp;
* I grew up alot, I am more mature than&nbsp;I once was.&nbsp;
* I have changed alot of&nbsp;my priorities.
&nbsp;* I have made mony beautiful friends who I cherish here!&nbsp;
